import React from "react";

class Header extends React.Component {
  render() {
    return <header>{this.props.title}</header>;
  }
}

class App extends React.Component {
  HELP_TEXT = "Help Text";

  render() {
    return (
      <div className="name">
        <Header title="Header" />
        <h1>{this.HELP_TEXT}</h1>
        <input
          placeholder={this.HELP_TEXT}
          onClick={this.inputClick}
          onMouseEnter={this.mouseHover}
        />
        <p>{this.HELP_TEXT === "Help Text" ? "Yes" : "No"}</p>
      </div>
    );
  }

  inputClick = () => console.log("click");
  mouseHover = () => console.log("mouse");
}

export default App
